import { makeStyles } from "@mui/styles";


export const useStyles = makeStyles({
  text:{
    '& p':{
      fontSize:20
    },
    marginBottom:38
  },
  container:{
    padding:87,
    marginRight:32,
    border:'1px solid rgba(0, 0, 0, 0.12)',
    borderRadius:16,
    boxShadow:'0px 12px 24px rgba(0, 0, 0, 0.12)'
  },
  img:{
    float:'left',
  },
  bottomText:{
    textAlign:'start'
  },
  text2:{
    color:'#737980',
    letterSpasing:1.5,
    fontSize:12
  },
  name:{
    letterSpasing:1.5,
    fontSize:12
  }
})
